const PostForm = () => {
    const [post, setPost] = useState([]);

    return (
        <div>
        <h1>Create your post</h1>
        <nav>
                    <Link to="create">
          <button type="button">
            Create Post
          </button>
        </Link>
        </nav>
        <div>
            <input type="text" placeholder="Title"/>
            <textarea placeholder="Type the content of your post here..."></textarea>
        </div>
        </div>
    );

}

export default PostForm;
